                "description": " with Austin Coleman<br> American born singer-songwriter and roots-rock artist Cody Marlowe found his inspiration at an early age in the soulful sounds of B.B. King, Merle Haggard, and the Allman Brothers. In the small town of Clermont, Georgia, Cody was born into a family of music. He learned how to play piano from his great-aunt and his mother, took guitar lessons with his grandpa and uncle, and was influenced vocally by his grandma, aunt, and sister. Katie (sister) sings with Cody in concerts and on many recordings. Marlowes songs explore the polarities of good and evil in an intriguing blend of lyrics featuring lost loves and hopeful musings.His 2013 album, Silver and Gold, is his third release since his first EP, Where You Are, released in 2010 and his first full length, Eighty Nine, released in 2011. For &quot;Silver and Gold,&quot; Marlowe teamed up with brothers, producer\/drummer Kevin Sellors and bass player Ryan Sellors, to form the back-up band the Dead Flowers. During the recording process, Marlowe recruited Joey Huffman on organ (Hank Jr., Matchbox 20) and Nathan Bedingfield on electric guitar (Aaron Shust). Silver and Gold is a return to the roots of rock n roll, country, blues, and honest songwriting; reminiscent of Tom Petty and the Black Crowes but with a modern edge inspired by childhood in the 90s.Released in 2016, the EP entitled &quot;Songs For Your Television&quot; contains six songs; four original tunes and two public domain classics featuring their personal interpretation. Head Held High is featured on the TLC aired program &quot;Welcome to Myrtle Manor.&quot; Rockin&#39; Robin and Nobody Knows You were both used in independent short-films by Oakey Productions.Cody&#39;s side project, &quot;Foxhollow,&quot; is a folk rock band hailing from Atlanta, Georgia. Founded by the songwriting duo, Cody Marlowe and Joel Hoffman, Foxhollow have toured regionally over the past 2 years with shows at Eddies Attic, Vinyl, and a show with Eddie Money at 37 Main. Foxhollow has one self-titled album featuring fan favorites such as &quot;Hello&quot; and &quot;Crazy.&quot;",
