                "description": " <p>HONEYWOOD:<p><strong>Honeywood\u00a0<\/strong>is a five-piece bluegrass jam band from Atlanta playing a mix of originals with rock and folk classics in bluegrass style. Formed in 2014, the band has an intense and unique sound featuring acoustic guitar, mandolin\/banjo, fiddle, bass and drums. A Honeywood show is full of great singing, hot pickin&#39;, dancing and fun for all ages...\u00a0a BLUEGRASS PARTY BAND!<br> \u00a0<p>WEBSTER:<p>Webster&#39;s music enjoys wide appeal. The 5-piece band formed in 2005 and covers artists including The Grateful Dead, Bob Dylan, Neil Young, Rolling Stones, Tom Petty, Phish, REM, Van Morrison, among others. Their focus is on improvisational and inspirational live music. The band\u2019s tangible energy takes an audience on a musical journey, encouraging a fun and active experience. They have performed at numerous venues throughout greater Atlanta, sharing the stage with major headline acts including Government Mule, Chris Robinson, Drive-By Truckers & The Wailers. Come check out Webster!<p>\u00a0<\/p><\/p><\/p><\/p><\/p>",
